from sys import stdin

def main():
    n = int(stdin.readline())
    words = [stdin.readline().strip() for _ in range(n)]
    start, end = words[:2]
    words = set(words[2:])
    if start == end:
        print(0)
        print(-1)
        return

    def neighbors(word):
        for i, c in enumerate(word):
            for d in product('abcdefghijklmnopqrstuvwxyz', repeat=1):
                yield word[:i] + d[0] + word[i+1:]

    def bfs(start, end):
        q = [(start, 1)]
        seen = {start}
        while q:
            word, dist = q.pop(0)
            if word == end:
                return dist
            for n in neighbors(word):
                if n not in seen and n in words:
                    seen.add(n)
                    q.append((n, dist + 1))
        return -1

    best = 0
    best_word = ''
    for word in words:
        words.remove(word)
        dist = bfs(start, end)
        if dist != -1:
            if dist < best or (dist == best and word < best_word):
                best = dist
                best_word = word
        words.add(word)
    if best == 0:
        print(0)
        print(-1)
    else:
        print(best_word)
        print(best)

